<h2>语法基础</h2>
<ul>
<li>
<p>Java的程序实际上是在虚拟机JVM上运行的，这就完美实现了可移植性，解决了在不同操作系统或者不同平台上由于数据类型等其他方面不同造成的错误</p>
</li>
<li>
<p>Java中，每一个函数，实际上就是类中的方法。</p>
